import { LOAD_BOX3_COMPLETE } from "../sagas";

const initialState = {
    loggedIn: false
}

export default function(state = initialState, action) {
    switch(action.type) {
        case LOAD_BOX3_COMPLETE:
            return {
                ...state,
                ...action.payload,
            }
        default:
            return state
    }
}
